    public interface InfranetField
    {
        String Name { get; }
        int ID { get; }
        String Type { get; }
    }

    class FieldImpl : InfranetField
    {
        private String _type;
        private String _name;
        private int _id;

        public FieldImpl(String name, int id, String type)
        {
            _name = name;
            _type = type;
            _id = id;
        }

        #region InfranetField Members

        public string Type
        {
            get { return _type; }
        }

        public int ID
        {
            get { return _id; }
        }

        public String Name
        {
            get { return _name; }
        }
        
        #endregion
    }

